import React from 'react'
import './gameboard.css'

export default function Gameboard() {
    function boardProp(props){
        return <div>
            <div><h1>{props.num}</h1></div>
        </div>
    }

  return (
    <div>
        <boardProp num="1"/>
    </div>
  )
}
